// Export the `session` prop to use sessions with Server Side Rendering
export const getServerSideProps = async (context) => {
  const { req, res } = context;
  const session = await getServerSession(req, res, authOptions);

  if (!session) {
    return {
      redirect: {
        destination: "/",
        permanent: false,
      },
    };
  }

  const nas = process.env.NEXTAUTH_SECRET;
  const jot = await getToken({req, nas})
  const accessToken = jot?.access_token;

  // console.log(`curl -X "GET" "https://api.spotify.com/v1/me/playlists/"
  //   -H "Accept: application/json" -H "Content-Type: application/json"
  //   -H "Authorization: Bearer ${accessToken}"`)
  const playlistResponse = await fetch("https://api.spotify.com/v1/me/playlists", {
    method: "GET",
    headers: {
      "Content-Type": "application/json",
      "Authorization": `Bearer ${accessToken}`
    },
    json: true
  });

  const mePlaylists = (playlistResponse.ok)? await playlistResponse.json() : {items:[], total: 0};
  const mePlaylistCount = mePlaylists.total;

  return {
    props: {
      userPlaylists: mePlaylists.items,
      userTotalPlaylists: mePlaylistCount,
    },
  };
}
